public static void createTempDir() {
  String cname = getSimpleClassName();
  dataDir = new File(System.getProperty("java.io.tmpdir")
          + System.getProperty("file.separator")
          +"solrtest-" + cname + "-" + System.currentTimeMillis());
  dataDir.mkdirs();
}

